(49699, 131333, 0, 1, '三人遊cover', '', '2006-01-02 00:00:00', 1970, 0, 1, 7, '有些話妳選擇不對他說　妳說某種脆弱　我才感同身受\r\n我永遠都願意當個聽眾　安慰妳的痛　保護著妳從始至終　就算妳的愛\r\n屬於他了　就算妳的手　他還牽著　就算妳累了　我會在這\r\n\r\n一人留　兩人疚　三人遊　悄悄的　遠遠的　或許捨不得　默默的　靜靜的　或許很值得\r\n我還在某處守候著　說不定這也是一種　幸福的資格\r\n至少我們中還有人能快樂　這樣就已足夠了\r\n\r\n有些話我選擇保持沉默　別把實話說破　隱藏我的寂寞\r\n妳的情緒依然把我牽動　躲在妳心中　角落的心事我能懂\r\n就算妳的愛　屬於他了　就算妳的手　他還牽著　就算妳累了　我會在這\r\n\r\n一人留　兩人疚　三人遊　悄悄的　遠遠的　或許捨不得　默默的　靜靜的　或許很值得\r\n我還在某處守候著　說不定這也是一種　幸福的資格\r\n至少我們中還有人能快樂　這樣就已足夠了\r\n\r\n不知道　不知道　不知道　為什麼　為什麼　我的愛\r\n我的愛還留不住妳的離開　卻都總在　等待著妳回來\r\n\r\n一人留　兩人疚　三人遊　悄悄的　遠遠的　或許捨不得　默默的　靜靜的　或許很值得\r\n我還在某處守候著　說不定這也是一種　得不到的　卻美好的\r\n至少我們中還有人能快樂　這樣就已足夠了\r\n至少我們中還有人能快樂　這樣就已經夠了\r\n', '', 220, '', '', '', '', '', '', 0, 1, 1, '2012-06-20 17:59:36', '2013-10-07 17:21:40', '2013-04-20 11:36:36'),
(49700, 129787, 0, 1, '來不及說愛妳', '', '2012-06-20 00:00:00', 2000, 0, 1, 7, '來不及說愛妳\r\n詞/莎 曲/編/唱/Yawi\r\n\r\n夜晚的教室抽屜 我落下了一段回憶\r\n筆記裡那些點滴 寫出我們的默契\r\n就像一種契機 太陽和月亮的約定\r\n什麼時候能相遇 妳隱藏妳的美麗\r\n就像我 來不及說 愛妳\r\n\r\n妳笑像微風 吹走了寂寞\r\n妳卻沒發現 有人在等候\r\n喜怒哀樂 被你牽動\r\n我不像我 卻甘心為妳逗留\r\n\r\n妳一舉一動 好想先看懂\r\n就算我陪伴 對妳來說很普通\r\n不是王子 卻有想守護的彩虹\r\n讓我當妳 手心裡最真實的溫度', '', 299, '', 'Yawi', ' 郭莎莎', 'Yawi', '', '', 0, 0, 1, '2012-06-20 18:53:21', '2013-10-07 17:21:40', '0000-00-00 00:00:00'),
(49701, 129787, 0, 1, '來不及說愛妳', '', '2012-06-20 00:00:00', 2000, 0, 1, 7, '來不及說愛妳\r\n詞/莎 曲/編/唱/Yawi\r\n\r\n夜晚的教室抽屜 我落下了一段回憶\r\n筆記裡那些點滴 寫出我們的默契\r\n就像一種契機 太陽和月亮的約定\r\n什麼時候能相遇 妳隱藏妳的美麗\r\n就像我 來不及說 愛妳\r\n\r\n\r\n妳笑像微風 吹走了寂寞\r\n妳卻沒發現 有人在等候\r\n喜怒哀樂 被妳牽動\r\n我不像我 卻甘心為妳逗留\r\n\r\n妳一舉一動 好想先看懂\r\n就算我陪伴 對妳來說很普通\r\n不是王子 卻有想守護的彩虹\r\n讓我當妳 手心裡最真實的溫度\r\n', '', 299, '', 'Yawi', '郭莎莎', 'Yawi', '', '', 0, 0, 0, '2012-06-20 19:05:28', '2015-03-12 13:53:25', '0000-00-00 00:00:00'),
