(49713, 150446, 0, 1, '雨 你別再下了', '', '2012-06-20 00:00:00', 2000, 0, 2, 1, '詞:振剛 曲:振剛 編曲:振剛 混音:振剛\r\n\r\n雨你別在下了 雨你別在下了 雨你別在下了 你知不知道你這樣下多少人不能回家\r\n\r\n雨你別在下了 雨你別在下了 你到底要下多久 你到底要下多久\r\n\r\n我一打開電視就看到主播"任立渝" 果然沒錯這幾天都在下雨\r\n\r\n你這麼下 都不會覺得煩膩\r\n\r\n颱風妳真的那麼愛台灣 為什麼最近都要來這玩\r\n\r\n把這裡都弄淹水 妳是不是就開心一點\r\n\r\n\r\n我出門才忘了要帶雨具 我就這樣淋濕在馬路邊', '', 200, '', '振剛', '振剛', '振剛', 'JHEN振剛', '', 0, 1, 0, '2012-06-20 23:09:47', '2015-03-12 13:53:25', '0000-00-00 00:00:00'),
