(49717, 91245, 0, 1, '明天', '', '2012-06-21 00:00:00', 2000, 0, 2, 7, '世界從何時不只屬於自己 一陣陰晴不定\r\n萬里無雲怎會出現雷擊 一切因你而起\r\n看著不同的心情來來去去 像場藝術電影\r\n因為在乎於是心不由己 開出許多絮語\r\n\r\n其實我想告訴你 朋友\r\n記憶不隨時間淡去  脈動更加清晰\r\n\r\n明天 或許你是晴空萬里 我會和你去翱翔天際\r\n或許你有陰霾憂鬱 我會找你去看場電影\r\n明天 或許你會下場陣雨 我會撐傘靜靜地陪著你\r\n怎樣的天氣 (無所謂) 我只希望你有好心情\r\n\r\n每當我們在同一個世界裡 有了更多勇氣\r\n不論 明天是怎樣的天氣 你開始不擔心\r\n\r\n我還是想告訴你 朋友\r\n記憶不隨時間淡去  脈動更加清晰', '', 199, '', '蔡明耀', '蘇育霆', '蔡明耀', '', '', 0, 1, 0, '2012-06-21 03:44:30', '2015-03-12 13:53:25', '0000-00-00 00:00:00'),
