(49721, 9753, 0, 1, '一樣的表情', '盡管無法見面\r\n儘管只剩下回憶\r\n儘管距離多麼遙遠\r\n儘管現實多麼複雜\r\n\r\n至少當我們又想到同一個曾經有過的畫面\r\n臉上浮現了一樣的表情', '2012-06-01 00:00:00', 2012, 20, 0, 7, '熟悉的氣味微醺在夢裡\r\n睜開眼是陌生的場景\r\n試著洗去記憶 應該徹底忘記\r\n任何小細節都能挑起我的神經\r\n\r\n沙灘上寫下的字跡 \r\n浪花帶走的腳印\r\n\r\n帶不走只能放在心裡 \r\n腦海中你留下的痕跡\r\n愧疚是放不下的原因\r\n你說時間會讓這一切都得以平靜\r\n\r\n失眠的夜裡\r\n空蕩蕩的房裡\r\n閉上眼睛還是會想起\r\n\r\n你的眼 你的嘴 那純白的臉\r\n彷彿才剛離開 就在昨天\r\n說再見 太強烈 怎麼面對\r\n拿著筆卻無法畫下句點\r\n\r\n我一個人該怎麼辦\r\n忍住眼淚  好難捱\r\n你要我看開 要勇敢\r\n我相信你一直都在\r\n\r\n陪我看海  從沒離開', '', 262, '', '阿招', '教父', '寡人樂團', '', '', 0, 1, 0, '2012-06-21 19:49:10', '2015-03-12 13:53:25', '0000-00-00 00:00:00'),
(49722, 9753, 0, 1, '活出自我', '我的思考我的邏輯打造的世界\r\n請尊重我的夢想井水不犯河水\r\n我用我的生命語言唱的一切\r\nWelcome to my neverland', '2012-06-01 00:00:00', 2012, 20, 0, 7, '你們都閉嘴 給我冷靜思考的空間\r\n我的方向由我來選 我要進要退 \r\n不需要誰的指點 在這世界沒有多長時間 \r\n而我並不是無所謂 \r\n你說我不懂 我就是不懂才想去了解 \r\n去學習 去體驗 到處撒野\r\n受傷又怎樣 革命怎麼能不流血\r\n我會再站起來 接受考驗\r\n \r\n\r\n我的思考我的邏輯打造的世界\r\n請尊重我的夢想井水不犯河水\r\n我用我的生命語言唱的一切\r\nWelcome to my neverland\r\n\r\n\r\n命運從來不跟幸運站在同一邊\r\n成功需要更多的沉澱\r\n機會從來不會碰巧站在你的面前\r\n傻傻的等只有傻傻的毀滅\r\nI say...\r\n你別再靠背\r\n這是我的人生 這裡頭沒有絕對\r\n你別講廢話\r\n我聽夠了受夠了這一切\r\n\r\n這是我的歌 我要唱出自我\r\n這是我的路 我要走出自我\r\n這是我的遊戲 我要玩出自我\r\n這是我的命 我要活出自我', '', 198, '', '阿招', '教父', '寡人樂團', '', '', 0, 1, 0, '2012-06-21 19:49:50', '2015-03-12 13:53:25', '0000-00-00 00:00:00'),
(49723, 9753, 0, 1, 'Freedom in tonight (F.I.T解放今晚) DEMO VERSION', '是否厭倦了每個晚上面對的一成不變\r\n當壓力,無奈,現實,人心\r\n搞的喘不過氣來的時候\r\n\r\n這首歌～要你在今晚解放\r\n\r\n（建議搭配啤酒使用）', '2012-06-01 00:00:00', 2012, 20, 0, 7, '首先撇開你的良心\r\n往邪惡方向前進\r\n放棄你的本性才能找到開心\r\n然後忘記原本的你\r\n丟掉該有的冷靜\r\n無論如何今晚墮落到底永無止盡\r\n\r\n闖出籠子的猛獸 飢餓的盯著四週\r\n壓抑太久的野性就要找到出口\r\n大口吃肉大口喝酒\r\n不乾杯不夠朋友\r\n不要跟我囉嗦\r\n哪來那麼多的藉口\r\n\r\n我要放鬆  我要墮落  \r\n放手一搏  別管我\r\n\r\n心中的火開始沸騰\r\n我躺在地上打滾\r\n東拉西扯搞得你我衣衫不整\r\n欸我有點渴了\r\n幫我搞點喝的\r\n我說渴了不是可樂\r\n你是不是聾了?\r\n莫名其妙 怎麼這麼好笑\r\n世界好小 怎麼這麼靠腰?\r\n希望星期一從日曆上被撤掉\r\n希望老闆走在路上被車撞到\r\n\r\n放縱是痛苦的解藥   \r\n你多久沒有自在的笑\r\n\r\n我把一天當兩天用 \r\n感覺還是不夠\r\n狂歡之後 心中浮現的卻全都是寂寞\r\n再次握緊拳頭 決定了我不想走! 再來一手! \r\n曲終人散 人去樓空 只剩我\r\n垂死掙扎逗留 不想動\r\n就算只剩一分鐘 也要緊緊把握\r\n剩下力氣不多 但我梭!!!\r\n\r\n他媽的陽光劃開天空\r\n該死的時間不停的走\r\n或許我應該好好振作 別煩我\r\n假期就快要結束了\r\n想到這裡我又悶了\r\n一次兩次的重倒覆轍..\r\n\r\nF.I.T  freedom in tonight! X4\r\n', '', 216, '', '阿招', '教父', '寡人樂團', '', '', 0, 1, 0, '2012-06-21 19:50:29', '2015-03-12 13:53:25', '0000-00-00 00:00:00'),
