(49727, 145017, 0, 1, '如此自然 DEMO', '', '2012-06-21 00:00:00', 2000, 0, 2, 14, '如此自然- \r\n \r\n每天都為 別人做好多事根本 沒有時間走到陽光下太多目標\r\n無關自身久了就會 腦袋格式化突然一天 突然就在一瞬之間\r\nall the maze i figure it out~我要偷偷 離開這裡放下一切 走出象牙塔\r\nbreak out and find my love\r\n \r\n[chorus]\r\n \r\n沒有拘束，身體自然呼應想法   隨時隨地，不需要等待回答\r\n收拾鼓棒，Bass Keyborad and my Guitar\r\nNatural outcome我們現在就要出發你準備好了嗎\r\nfor u , my so-called love\r\n \r\n[bridge] \r\nwe are Natural Outcome~', '', 251, '', '吳浚瑋', '吳浚瑋', 'Natural Outcome Bnd', '', '', 0, 0, 0, '2012-06-21 23:30:29', '2015-03-12 13:53:25', '0000-00-00 00:00:00'),
