(49740, 91245, 0, 1, '暗黑世界', '', '2012-06-22 00:00:00', 2000, 0, 2, 7, '暗黑世界\r\n詞：蘇育霆	曲/編曲：蔡明耀   唱：羅竺\r\n\r\n諸神戰火綿延肆虐的世界  創世神留的秩序瓦解\r\n今天過後是誰的明天  無懼毀滅才能決定整個世界\r\n\r\n神器淡出光輝  貪婪蒙蔽了眼\r\n羅織無謂是非  爭奪就在瞬間\r\n\r\n慾望散發香味  挑起抑鬱的罪\r\n酒杯渴望鮮血  大家都別虛偽\r\n\r\n難以拒絕 支配的喜悅  是謊言 還是信念 隨便\r\n  \r\n黃金島精靈箭  焚毀亡靈席捲過的範圍\r\n不對邪惡垂憐  或讓明天赦免\r\n\r\n找尋復活條件  破解封印拯救她的笑臉\r\n不讓慾望支配  保衛純澈的念\r\n', '', 134, '', '蔡明耀', '蘇育霆', '蔡明耀', '', '', 0, 1, 0, '2012-06-22 04:19:01', '2015-03-12 13:53:26', '0000-00-00 00:00:00'),
(49741, 91245, 0, 1, '碑', '', '2012-06-22 00:00:00', 2000, 0, 2, 7, '碑\r\n詞：蘇育霆	曲/編曲：蔡明耀	演唱：歪歪\r\n曲序：A→B→C1→間奏→A→B→C2→C3→D→C1\r\n\r\nA\r\n星塵沈澱黑夜  野花悄悄凋謝\r\n美麗中帶點沈醉\r\n老樹孤立荒野  不和諧的淒美\r\n聖潔開始被威脅\r\nB \r\n荒野漸緋  又刻上了誰的碑\r\n湖水漸豔  月的白紗不再皎潔\r\n遍地白雪  誰還記得誰的臉\r\n下個明天\r\n   \r\nC1\r\n瑰麗的線   又濺到誰的臉  幾回\r\n是天使的淚  還是魔鬼的血  難辨\r\n碑  立過誰的心間  紀念\r\n描繪幾幅血淚  不畏  眼前危險\r\n \r\nC2\r\n交會幾回  為了一場無悔  徘徊\r\n天使魔鬼相會  是誰定了誰的罪  無解\r\n追  為了堅持信念  完美\r\n即使付出一切  為了  理想的世界\r\n \r\nC3\r\n眼  看穿 無垠空間  深邃\r\n穿越到終點  超越無限的範圍  一切\r\n眠  沉落 無盡時間  失陷\r\n不見底的深淵  埋葬  所有善變\r\n \r\nD\r\n春風媚  繁華葉\r\n朝露現  每到昏黃如人歸\r\n隨雁飛  直上天邊  天地多少事輪迴\r\n \r\n秋風吹  枯枝斜\r\n盛意遠  迷濛不從淚惟悲\r\n生意滅  怎能續緣\r\n', '', 294, '', '蔡明耀', '蘇育霆', '蔡明耀', '', '', 0, 1, 0, '2012-06-22 04:19:51', '2015-03-12 13:53:26', '0000-00-00 00:00:00'),
(49742, 10394, 2910, 1, 'Intro', '', '2010-11-19 00:00:00', 2010, 19, 0, 7, '', '', 228, '', '蔡明諺', '', 'HiJack', '', 'TWAE31400125', 1, 1, 0, '2012-06-22 05:33:30', '2015-03-12 13:53:26', '0000-00-00 00:00:00'),
(49743, 10394, 2910, 2, 'True Song', '', '2010-11-19 00:00:00', 2010, 19, 0, 7, '想像逐漸退去的時候\r\n我的直覺失去了什麼\r\n試著證明這一切\r\n還有留下那種單純的氣味\r\nWill you forget?\r\n\r\n思緒已隨著音樂遊走\r\n身體也跟著節奏擺動\r\n這時候已沒有離開的藉口\r\n\r\n不安的情緒拋在腦後\r\n現在的記憶失去輪廓\r\n這時候只剩下旋律陪著我\r\n\r\nWill you forget?\r\nYour true song', '', 244, '', '蔡明諺', '蔡明諺', 'HiJack', '', 'TWAE31400126', 1, 1, 0, '2012-06-22 05:40:09', '2015-03-12 13:53:26', '0000-00-00 00:00:00'),
(49744, 10394, 2910, 3, 'It''s Over', '', '2010-11-19 00:00:00', 2010, 19, 0, 7, 'So many things I need to do\r\nMy world is overwhelmed everyday\r\nPretend to be kind to everyone\r\nIt means nothing to me anymore\r\n\r\nI was trying not to face\r\nEverything that seems unfair to me, how to live\r\nI was thinking where to go\r\nEscaping from this big bubble\r\nA pathetic real world\r\n\r\nOn my way\r\nWhat I’m thinking is always right, it''s always fine\r\nBeing frustrated\r\nI still keep my pace\r\nWonder why I have to worry about that\r\nHow to fix it \r\n\r\nThere’s no way to\r\nknow how people really thinking about you\r\nThere’s no need to care what they talk about you\r\nThere’s no reason to stop what you wanna do\r\nIt’s over\r\n\r\nOn my way\r\nWhat I’m thinking is always right, it''s always fine, it''s always kind, it''s always fine \r\nNot afraid\r\nWonder why I have to worry about that\r\nHow to fix it \r\n\r\nThere’s no way to\r\nknow how people really thinking about you\r\nIt’s over', '', 317, '', '蔡明諺', '蔡明諺', 'HiJack', '', 'TWAE31400127', 1, 1, 0, '2012-06-22 05:40:58', '2015-03-12 13:53:26', '0000-00-00 00:00:00'),
(49745, 10394, 2910, 4, '錯覺', '', '2010-11-19 00:00:00', 2010, 19, 0, 7, '將自己的心寄放在荒蕪的地方\r\n留下所有的煩惱在過去的時光\r\n\r\n沈醉  沒有感覺\r\n轉眼  迷失一切\r\n\r\n深陷  這滋味\r\n撕裂  這錯覺\r\n\r\n睜開眼  我又茫然地渡過了一天\r\n閉上眼   卻又被真實的惡夢拉回\r\n\r\n沒有誰  能夠解決\r\n這瞬間  支離破碎\r\n\r\n這上癮的疲倦又再次地浮現\r\n白天  黑夜  沒差別\r\n\r\n是為了什麼而眷戀\r\n卻到了現在才了解\r\n現實的世界太虛偽\r\n卻到了現在才了解\r\n\r\n深陷  這滋味\r\n撕裂  這錯覺\r\n\r\n鏡子前的我現在又是什麼樣子\r\n早已經沒有理智\r\n有沒有一種方法能夠跳脫現實\r\n進入夢境的那一刻\r\n期待著\r\n短暫的\r\n快樂', '', 289, '', '蔡明諺', '蔡明諺', 'HiJack', '', 'TWAE31400128', 1, 1, 0, '2012-06-22 05:41:43', '2015-03-12 13:53:26', '0000-00-00 00:00:00'),
(49746, 10394, 2910, 5, 'Waste', '', '2010-11-19 00:00:00', 2010, 19, 0, 7, 'Chasing a chance to realize\r\nI hate to run\r\nNo matter how hard I have tried\r\nIt seems too far\r\n\r\nRunning away to get survived\r\nI have to run\r\nNo matter how hard they have tried\r\nIt makes me laugh\r\n\r\nBe satisfied\r\nBe a normal guy\r\nDreams can’t come true\r\nLife won’t go back\r\nMaybe someone will try to find the true way out\r\nPrevent from  being sacrificed\r\nNow it’s time for changing my mind\r\n\r\nWe are following the rules blindly in this world\r\nAnd only what I need is to be free\r\nEvery part of me is seeking for revolution\r\nCome on\r\nDon’t let anyone to waste your time\r\n(Come on don’t let anyone to waste your life)\r\n \r\nDon''t waste your ___\r\n', '', 317, '', '蔡明諺', '蔡明諺', 'HiJack', '', 'TWAE31400129', 1, 1, 0, '2012-06-22 05:42:29', '2015-03-12 13:53:26', '0000-00-00 00:00:00'),
