(49842, 123435, 4576, 1, '飛行器', '', '2012-06-23 00:00:00', 2012, 19, 0, 7, '嘿，是否曾懷疑什麼\r\n而我們都有想自由的夢\r\n總有太多看不見的錯\r\n越是受挫才能夠放開衝\r\n\r\n飛到夢裡，追逐自己\r\n總是等待卻未曾期待\r\n我們不一樣的未來\r\n能夠擁有怎樣的不同\r\n\r\n嘿，是否曾相信什麼\r\n而我們都有不平凡的夢\r\n別怕失敗而帶來遺憾\r\n我們都相同的現在\r\n能夠擁抱真實的初衷\r\n', '', 349, '', 'OffsideLane', '小幹', 'OffsideLane', '獨立製作', '', 0, 1, 0, '2012-06-22 16:02:10', '2015-03-12 13:53:29', '0000-00-00 00:00:00'),
