(49846, 123435, 4576, 2, '流行歌', '', '2012-06-23 00:00:00', 2012, 19, 0, 7, '當我徘徊猶豫不前\r\n總無法闔上眼\r\n那樣的夜色為何那麼遠\r\n\r\n走在熟悉熱鬧的街\r\n我想起你的臉\r\n那樣憂鬱的笑臉卻有閃耀的雙眼\r\n\r\n我不懂\r\n為何在迷失之後的我\r\n無法挽回什麼\r\n我不懂\r\n只是想要你能陪著我\r\n不停歇一直往著前\r\n\r\n最後還是回到原點\r\n失去你的一切\r\n那曾經說過的誓言都變成了謊言\r\n', '', 271, '', 'OffsideLane', '小幹, Thomas', 'OffsideLane', '獨立製作', '', 0, 1, 0, '2012-06-22 16:15:37', '2015-03-12 13:53:29', '0000-00-00 00:00:00'),
